    protected function rInt($type, $params)
    {
        static $statics = array();
        switch($type) {
            case 'random':
                return rand($params['min'], $params['max']);
                break;
            case 'seq':
                if(isset($statics[$params['name']])) {
                    $statics[$params['name']]++;
                }
                else {
                    $statics[$params['name']] = $params['start'];
                }
                return $statics[$params['name']];
            default:
                return null; 
